CREATE TABLE `userdata` (
    `id` INT AUTO_INCREMENT PRIMARY KEY,
    `Sevakcode` VARCHAR(100),
    `FIRST_NAME` TEXT,
    `LAST_NAME` VARCHAR(255),
    `ADDRESS` TEXT,
    `CITY_AREA_VILLAGE` TEXT,
    `PIN_CODE` TEXT,
    `TALUKA` TEXT,
    `BUSINESS_JOB` TEXT,
    `BUSINESS_ADDRESS` TEXT,
    `SINCE` TEXT,
    `REFERENCE` TEXT,
    `DOB` DATE,
    `MOBILE_NO` VARCHAR(24),
    `CONTACT_NO` VARCHAR(24),
    `DISTRICT` VARCHAR(255),
    `STATE` VARCHAR(255),
    `COUNTRY` VARCHAR(255),
    `CATEGORY` TEXT,
    `ACCIDENT` VARCHAR(255),
    `MEDICAL` VARCHAR(255),
    `image_url` TEXT,
    `Morning_presentation` TEXT,
    `evening_presentation` TEXT
); 


